import { TabsType } from '../constant/types';
import { Tabs } from '../components/Tabs';
import { orderData, orderSatatus, tabs } from '../constant/constent';
import CountValues from '../components/CountValues';
import { WhiteBgBox } from '../constant/CommonFunction';


export default function CustomTabs() {

    const options = [
        {value:'allCategory',label:'All Category'},
        {value:'category',label:'Category 1'}
    ]
    const handleClick = (tab: TabsType) => {
        console.log(tab, 'dfdskjhfklf')

    };

    return (
        <div className="">
            <Tabs tabs={tabs} tabsClick={(val: TabsType) => handleClick(val)} />
            <div className='bg-white border-[1px] mt-[-1px] border-[0E253C1A] p-4 '>

                <div className='flex gap-4 flex-1 flex-wrap '>
                    {
                        orderData.map((items) => {
                            return (
                                <CountValues orderData={items} />
                            )
                        })
                    }
                </div>
                <WhiteBgBox className='bg-[#F7F8F9] mt-4 rounded-4 flex-col p-0'>
                    <div className='flex p-3 items-center justify-between'>
                    <p className='text-black_200 font-semibold text-[18px]'>Order Status</p>
                    <select className='bg-white border-[1px] border-[#0E253C1A] h-[38px] !rounded-3 px-6'>
                        {
                            options.map((option,index)=>{
                                return(
                                    <option key={index} value={option.value}>{option.label}</option>
                                )
                            })
                        }
                    </select>
                    </div>
                    {/* <div className="border-b-[1px] border-[#0E253C1A] my-3" /> */}
                    <div className='flex'>
                        <div className='grid grid-cols-2'>
                            {
                                orderSatatus.map((items, index)=>{
                                    return(
                                        <div key={index} className={`flex border-[#0E253C1A] items-start  pt-8 pr-10 ${index %2 === 0 ? 'border-b-[1px] border-r-[1px]' : 'border-b-[1px] '}`}>
                                             <img className='pl-5' src={`images/${items.icon}`} alt='disk' />
                                             <div className='pb-8 pl-2'>
                                             <p className='text-[#0E253CD9] font-medium text-[12px]'>{items.label}</p>
                                             <p className='text-black_200 font-semibold text-[22px]'>{items.value}</p>
                                             </div>
                                        </div>
                                    )
                                })
                            }
                        </div>
                        <div>
                        test
                    </div>
                    </div>

                </WhiteBgBox>
            </div>

        </div>
    );
}
